                                                children: "The Church of God of Prophecy is a vibrant, worldwide body of believers, united in worship, working hand-in-hand to share God’s love and a message of hope to the brokenhearted. The Church of God of Prophecy has over one-and-a-half million members, worshiping in over 10,000 churches our missions in 125 nations of the world. Nearly 90% of our global membership is outside of North America. The Church of God movement began over one hundred years ago in the humble hearts of earnest believers in the rural mountains of Cherokee County, North Carolina. Following a miracle-filled revival that took place in a schoolhouse near Camp Creek in 1886, a small congregation formed a Christian Union to pray and study the scriptures. Soon led by an energetic young pastor from Indiana named A.J. Tomlinson, the group was more formally organized in 1903 into the Church of God and relocated its headquarters to neighboring Cleveland, Tennessee the following year. From Appalachia to the World, the century that followed saw great growth in all the branches of this movement. From the beginning, these spiritual pioneers traced their roots to the New Testament church and considered themselves a continuation of the Spirit-filled Christianity exhibited in the book of Acts. This desired connection with early Christian expression continues today with a mandate that all church decisions be committed to prayer and based on scripture. In contemporary theological terms, the Church of God of Prophecy is a Protestant, Evangelical, Wesleyan holiness, Pentecostal movement that believes in man’s freewill regarding salvation. -Courtesy of Church Of God Of Prophecy Headquarters"
